import MainLayout from './Components/Layout/MainLayout/MainLayout';

const root = ReactDOM.createRoot(
  document.getElementById('root') as HTMLElement
);
root.render(
<BrowserRouter>
<MainLayout/>
</BrowserRouter>
);

